const img='https://source.unsplash.com/random'

const Array = [
    {
        img:{img},
        title:'title1'
    },
    {
        img:`{img+'lion' }`,
        title:'title2'
    },
    {
        img:{img},
        title:'title3'
    },
    {
        img:{img},
        title:'title4'
    },
    {
        img:{img},
        title:'title5'
    },
    {
        img:{img},
        title:'title6'
    },
];

export default Array;
